import {getUser} from '../services/api.js';
import { useEffect,useState } from 'react';
import { Link } from 'react-router-dom';





const AllUser = () => {

    const [users, setUsers] = useState([]);

    useEffect(()=>{
        getAllUser();
    },[]);
    const getAllUser = async () => {
        let allUser = await getUser();
        setUsers(allUser.data);
        console.log("Aludser",allUser);
        console.log("usrs",users);       
        
    }
    
    return(
       
        
        <table className="table table-dark">
            <thead>
                <tr>
                    <th scope="col">#</th>
                    <th scope="col">Name</th>
                    <th scope="col">Username</th>
                    <th scope="col">Email</th>
                    <th scope="col">Phone</th>
                    <th score="col"></th>
                </tr>
            </thead>
            <tbody>            
                    {
                        users.map(({_id,name,username,email,phone})=>(
                            <tr>{console.log(email)}
                            <td>{_id}</td>
                            <td>{name}</td>
                            <td>{username}</td>
                            <td>{email}</td>
                            <td>{phone}</td>
                            <td>
                                <button type="button" className="btn btn-info" componenet= {Link} to={`/editUser/${_id}`}>Edit</button>
                                
                                <button type="button" className="btn btn-danger">Delete</button>
                            </td>
                            
                            </tr>
                        ))                     
                       
                    }                  
                               
            </tbody>
           
        </table>
        
    )
}


export default AllUser
